INSERT INTO `accounts_project` (`id`, `name`, `description`, `end_date`, `start_date`, `last_modified_date`, `advertisement`, `status`, `slug`,  `category_id` ,`amount`) VALUES (59,'ترجمه کتاب','ما برای کار خود در زمینه ترجمه کتاب های خارجی به زبان روان فارسی نیاز به دانشجویان توانا و با انگیزه داریم.','2021-03-15 22:12:31.000000','2021-02-05 22:12:46.000000','2021-02-05 22:13:31.886162',1,'WAITING','ترجمه-کتاب',52,4000000),(60,'فناوری','به افرادی پویا و پر تلاش در تیم خود برای پروژه فناوری که نیاز به امنیت و تحلیل بالایی دارد نیازمندیم.','2021-02-09 18:48:19.578727','2021-01-23 03:26:32.000000','2021-02-06 03:29:39.889918',1,'ENDED','فناوری',51,3000000),(61,'Analysis','برای ما زیبایی پروژه معیار اول است از خلاقان دعوت می شود.','2021-02-04 03:35:35.000000','2021-01-23 03:35:43.000000','2021-02-06 03:36:08.267490',1,'DELETED','analysis',53,0),(62,'تکاوری','نیاز به برقراری ارتباط با سرور جزو بزرگ ترین خواسته های ما است.','2021-02-09 18:47:47.204072','2021-02-06 17:39:36.000000','2021-02-06 03:50:13.844120',1,'ENDED','تکاوری',72,5000009),(63,'تیکتینگ','ما در تیم خود به دنبال افرادی هستیم که تحقیق و پژوهش جزو مهم ترین مسائل زندگیشان باشد.و بتوانیم بهترین تحلیل ها را پیش ببریم.','2021-01-31 03:57:08.000000','2021-06-05 15:18:30.298774','2021-02-06 03:57:31.385613',1,'STARTED','تیکتینگ',51,80),(64,'نوبت دهی','رهبری گروهی بزرگ نیاز به یک تیمی فرهیختته دارد ما از شما دعوت به همکاری می کنیم تا بهترین تیم را برای خود داشته باشیم.','2020-11-19 17:05:30.000000','2021-02-09 18:47:57.389857','2021-02-06 04:00:05.721647',1,'STARTED','نوبت-دهی',55,200000),(67,'اساتید','ما دنبال بهترین ساختار برای ایجاد یک تیم قوی برای کمک به دانشجویان هستیم.','2022-02-07 21:39:20.000000','2021-02-09 18:06:15.028742','2021-02-07 21:39:20.403922',1,'STARTED','اساتید',52,30000000);
